import React, { Component } from 'react'
import './MobileNavbar.css'
import { NavLink } from 'react-router-dom'
import { Container } from 'semantic-ui-react'



class MobileNavbar extends Component {
    render() {
        const today = new Date();
        const date = today.getFullYear()+'-'+(today.getMonth()+1)+'-'+today.getDate();
        const formatedDate = date.split("-")
        const reformatedDate = formatedDate[0].split("") 
        const cfFormatDate = reformatedDate[2] + reformatedDate[3] + 0 + formatedDate[1] + formatedDate[2]

        return (
            <>
             <header id="nav-wrapper">
                <nav id="nav">
                <NavLink to='/'>   
                    {/* <div className="nav left">
                        <span className="gradient skew"> 
                            <h1 className="logo un-skew">WODSHARE</h1>
                        </span>
                    </div> */}
                </NavLink>
                        <h2>WODSHARE</h2>
                    <nav id="site-navigation" aria-label="Menu">
                        <ul id="main-menu">
                        <li><a href="#">Home</a></li>
                        <li><a href="#">Shop</a></li>
                        <li><a href="#">Blog</a></li>
                        <li><a href="#">About</a></li>
                        <li><a href="#">Contact</a></li>
                        </ul>

                    </nav>


                </nav>
            </header>
            </>
        );
    }
}

